※ブラックは完売しました。<br><table width='600' border='0' align='center' cellpadding='0' cellspacing='0'><tr><td><font color='#009999' size='5'><strong>NHKニュースおはよう日本まちかど情報室で紹介されました。食べたくなくなる言葉をしゃべる!!</strong></font></td></tr></table><br><table width='610' border='0' align='center' cellpadding='1' cellspacing='0'><tr><td width='610' valign='top' align='center'><div><img src='https://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5265/8292bs-01.jpg' width='600' height='444'><br><font size=3></font></div><br><table width='600' border='0' align='center' cellpadding='1' cellspacing='0'><tr><td width='600' valign='top' align='left'><font size='3'>(C)Hashy<br><br>第77回東京インターナショナル・ギフトショー春2014<br>女性のハートをキャッチするギフトグッズコレクション　大賞受賞<br><br><br>■おしゃべり例<br>・その一口がデブの元!<br>・体重何キロだっけ?大台にのっちゃうよ～!<br>・ふーん。太る人はやっぱり食べてるのね。<br>・この・・・ブタやろうー!!<br>など</font></td></tr></table><br><br><table width='600' cellspacing='0' cellpadding='0' border='0' align='center'><tr><td width='600' valign='top'><div align='center'><img width='600' height='500' src='https://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5265/8292bs-02.jpg'><br><font size='3'></font></div><br></td></tr><tr><td width='600' valign='top'><div align='center'><img width='500' height='500' src='https://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5265/8292bs-03.jpg'><br><font size='3'>※イメージ</font></div><br></td></tr></table></td></tr></table><table width='600' border='0' align='center' cellpadding='1' cellspacing='0'><tr><td width='600' valign='top' align='left'><br><font size='3'>食べ物の誘惑に負けそうになった時、鼻のボタンを押します。ブーブーが食べたくなくなるような言葉をおしゃべり!!また、早食い防止機能付で、15秒～90秒に1回のペースで早食いを防止したり食事に集中できるような言葉を自動でおしゃべりします!!</font></td></tr></table><br><BR><div align='center'><IMG src='https://image.rakuten.co.jp/dietshop/cabinet/campaign/kobetusouryou.gif' alt='個別送料商品につきまして'></div><BR><BR><table width='300' border='0' cellspacing='0' cellpadding='0'><tr><td><font color='#333333' size='-1'>食べ物の誘惑に負けそうになった時、鼻のボタンを押します。ブーブーが食べたくなくなるような言葉をおしゃべり!!また、早食い防止機能付で、15秒～90秒に1回のペースで早食いを防止したり食事に集中できるような言葉を自動でおしゃべりします!!</font></td></tr></table><br><table width='300' border='0' cellpadding='5' cellspacing='1' bgcolor='#666666'><tr bgcolor='#FFFFFF'><td align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>サイズ</font></td><td align='left'><font color='#333333' size='-1'>W70×D55×H85mm</font><br><font color='#333333' size='-1'>個装サイズ：9×9×9cm</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>重量</font></td><td align='left'><font color='#333333' size='-1'>個装重量：106g</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>素材・材質</font></td><td align='left'><font color='#333333' size='-1'>ABS</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>仕様</font></td><td align='left'><font color='#333333' size='-1'>使用電池:ボタン電池(LR44)×3個(テスト用付属)</font><br></td></tr><tr bgcolor='#FFFFFF'><td align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>製造国</font></td><td align='left'><font color='#333333' size='-1'>中国</font></td></tr></table><br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

